import React, { useEffect, useState } from 'react';

interface GeoLocation {
  lat: string;
  long: string;
}

interface Address {
  city: string;
  street: string;
  number: number;
  zipcode: string;
  location: GeoLocation;
}

interface Name {
  firstname: string;
  lastname: string;
}

interface User {
  id: number;
  email: string;
  username: string;
  password: string;
  name: Name;
  address: Address;
  phone: string;
}

const UserDetail: React.FC = (props) => {
  const [user, setUser] = useState<User | null>(null);

  useEffect(() => {
    fetch('https://fakestoreapi.com/users/1')
      .then((res) => res.json())
      .then((data) => setUser(data))
      .catch((err) => console.error(err));
  }, []);

  return (
    <div>
      <h1>User Details</h1>
      {user ? (
        <div className="user-card">
          <p><strong>ID:</strong> {user.id}</p>
          <p><strong>Email:</strong> {user.email}</p>
          <p><strong>Username:</strong> {user.username}</p>
          <p><strong>Password:</strong> {user.password}</p>
          <p><strong>Name:</strong> {user.name.firstname} {user.name.lastname}</p>
          <p><strong>Address:</strong> {`${user.address.number} ${user.address.street}, ${user.address.city}, ${user.address.zipcode}`}</p>
          <p><strong>Geo Location:</strong> Lat: {user.address.location.lat}, Long: {user.address.geolocation.long}</p>
          <p><strong>Phone:</strong> {user.phone}</p>
        </div>
      ) : (
        <p>Loading user details...</p>
      )}
    </div>
  );
};

export default UserDetail;
